import React from 'react';
import './App.css';
import GameOfLife from './GameOfLife';

class App extends React.Component {
  render() {
    return (
      <div className='App'>
        <h1>Jeu de la vie</h1>
        <GameOfLife />
      </div>
    )
  }
}

export default App;
